import React from 'react'
import Items from './logs-items'
import './logs.css'
import { useState } from 'react'

export default function Logs() {
  
  const logsData = [
    {
     id:1,
     date:new Date(2022,11,5,13,10),
     desc:"哈利波特",
     time:300
    },
    {
     id:2,
     date:new Date(2023,1,5,23,15),
     desc:"漫步華爾街",
     time:200
    },
    {
     id:3,
     date:new Date(2023,2,15,20,30),
     desc:"人間失格",
     time:120
    },
    {
     id:4,
     date:new Date(2023,6,20,23,5),
     desc:"烙印勇士",
     time:300
    }
  ]
  const [counter,setCounter] = useState(1);
  const tt = ()=>{
    setCounter(counter + 1)
  }

  const dataBase = logsData.map(items => <Items key={items.id} date={items.date}  desc={items.desc} time={items.time}/>)
  return (
    <div className='logs'>
      {dataBase}
      


      <div className='test'>{counter}
        <button onClick = {tt}>
          安安你好這是測試
        </button></div>
      </div>
    
  )
}
